import styled from "styled-components";

function TelaLogin() {
    return (
        <Container>
            <Title>MyWallet</Title>
            {/* <h1>Tela Login</h1> */}
        </Container>
    )
}

const Container = styled.div `
    width: 200px;
    height: 200px;
    background-color: #FFFFFF;
`

const Title = styled.h1 `
    font-family: 'Saira Stencil One', cursive; 
    font-size: 32px;
    color: #FFFFFF;
`


export default TelaLogin;
